class RegisterComponent {
    constructor(titleService, authService) {
        this.titleService = titleService;
        this.authService = authService;
        this.form = {};
        this.otp = {};
        this.isSuccessful = false;
        this.isVerified = false;
        this.isSignUpFailed = false;
        this.isFailedVerify = false;
        this.verify = false;
        this.errorMessage = {};
        this.theFile = null;
        this.fileToUpload = null;
        this.showLoadingIndicator = false;
    }
    ngOnInit() {
        //this.form.select_type = 2;
        this.titleService.setTitle('Register');
    }
    onSubmit() {
        this.showLoadingIndicator = true;
        {
            this.authService.register_new(this.form).subscribe(data => {
                console.log(data);
                this.isSuccessful = true;
                this.isSignUpFailed = false;
                this.number = this.form.other_mobile_number;
                this.verify = true;
                console.log(this.number);
                this.showLoadingIndicator = false;
            }, err => {
                this.errorMessage = err.error;
                this.isSignUpFailed = true;
                console.log(this.form);
                console.log(err);
                console.log(this.errorMessage);
                this.showLoadingIndicator = false;
            });
        }
    }
    onSubmitotp() {
        {
            this.authService.verify(this.number, this.otp.password).subscribe(data => {
                console.log(data);
                this.isVerified = true;
                this.verify = false;
            }, err => {
                this.errorMessage = err.error.message;
                this.verify = true;
                this.isFailedVerify = true;
                console.log(err);
            });
        }
    }
    onFileChanged(event) {
        this.readThis(event.target);
    }
    readThis(inputValue) {
        var file = inputValue.files[0];
        var myReader = new FileReader();
        myReader.onloadend = (e) => {
            this.image = myReader.result;
            console.log(myReader.result);
        };
        myReader.readAsDataURL(file);
    }
}
