class TopbarComponent {
    constructor(titleService, authService, tokenStorage, userService) {
        this.titleService = titleService;
        this.authService = authService;
        this.tokenStorage = tokenStorage;
        this.userService = userService;
        this.form = {};
        this.ared = {};
        this.isLoggedIn = false;
        this.isLoginFailed = false;
        this.errorMessage = '';
        this.roles = null;
        this.userEmail = null;
        this.userProfile = null;
        this.wishlist_length = 0;
    }
    ngOnInit() {
        this.userService.on().subscribe((message) => {
            if (message == 'true') {
                this.wishlistcount();
            }
        });
        if (this.tokenStorage.getToken() != null) {
            this.isLoggedIn = true;
            this.roles = this.tokenStorage.getUser().username;
            this.userEmail = this.tokenStorage.getUser().misc.email;
            this.userProfile = this.tokenStorage.getUser().misc.profile_pic;
            console.log(this.userEmail);
            console.log(this.userProfile);
            this.wishlistcount();
        }
    }
    wishlistcount() {
        this.userService.getwishlistdata().pipe().subscribe((wishlistdata) => {
            this.wishlistcontent = wishlistdata.data;
            this.wishlistresult = this.wishlistcontent;
            this.wishlist_length = this.wishlistcontent.length;
            console.log(this.wishlist_length);
            console.log(this.wishlistresult);
        }, err => {
            this.content = err.error.message;
        });
    }
}
